import logo from './logo.svg';
import './App.css';
import LandingPage from './components/LandingPage';
import AdminInterface from './components/AdminInterface';

function App() {
  return (
    <Router>
      <Routes>
      <Route path='/' element={<LandingPage />} />
      <Route path='/admin' element={<AdminInterface />} />
      </Routes>
    </Router>
  );
}

export default App;
